import React, { Component } from 'react';
import { Link } from "react-router-dom";

class Navegacion extends Component {
    render() {
        return (
            <div className="row justify-content-center d-flex">
                <div className="col-12 my-2 justify-content-beetween d-flex">
                    <nav className=" pink col-12 nav ">

                        <Link to={'/Pasteles'}> <a className="btn btn-link text-white m-2"> Pasteles </a> </Link>
                        <Link to={'/Galletas'}> <a className="btn btn-link text-white m-2"> Galletas </a></Link>
                        <Link to={'/Cremas Dulces'}> <a className="btn btn-link text-white m-2" > Cremas Dulces  </a></Link>
                        <Link to={'/Bizcochos'}> <a className="btn btn-link text-white m-2" >Bizcochos </a> </Link>
                        <Link to={'/Magdalenas'}> <a className="btn btn-link text-white m-2" > Magdalenas  </a> </Link>
                        <Link to={'/Mousse'}> <a className="btn btn-link text-white m-2" > Mousse  </a> </Link>
                        <Link to={'/Recetas Faciles'}> <a className="btn btn-link text-white m-2"> Recetas Faciles </a> </Link>
                    </nav>
                </div>
            </div>
        )
    }
}

export default Navegacion;
